export const Presentational=({history})=>{
    return(
        <div>
            <h2>Historial de Prestamos</h2>
            <table>
                <thead>
                    <tr>
                        <th>Título</th>
                        <th>Fecha Préstamo</th>
                        <th>Fecha Entrega</th>
                    </tr>
                </thead>
                <tbody>
                    {history.map((item, i) => {
                        return [
                            <tr key={i} 
                            // onClick={toggleMobileOpen.bind(this, i)}>
                            >
                            {/* <td className="toggler">
                                {item.mobile_open && <ArrowUp />}
                                {!item.mobile_open && <ArrowDown />}
                            </td> */}
                            <td>{item.titulo}</td>
                            <td>{item.fecha_prestamo}</td>
                            <td>{item.fecha_entrega}</td>
                            </tr>,

                            // //This inline conditional makes it weird but this works
                            // ...[item.mobile_open &&
                            // <tr className="test-td">
                            //     <td>...</td>
                            // </tr>
                            // ]
                        ];
                    })}
                </tbody>
            </table>
        </div>
    )
}
